    const [counter , setCounter] = useState(0);
    return (
        <Box sx={{ flexGrow: 1 }}>
            <AppBar position="static">
                <Toolbar>
                    <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>Provide test</Typography>
                </ Toolbar>
            </ AppBar>
        </ Box>
    )
}
